import VueRouter from 'vue-router'
import Vue from 'vue'

Vue.use(VueRouter)

import Home from '@/pages/Home/index'
import Search from '@/pages/Search'
import Login from '@/pages/Login'
import Register from '@/pages/Register'

export default new VueRouter({
  routes:[
    {
    path:'./home',
    components:Home
    },
    {
      path:'./search',
      components:Search
    },
    {
      path:'./login',
      components:Login
    },
    {
      path:'./register',
      components:Register
    }, 
]
})
